import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div>
      <div className="toparea">
        <img className="image" src="https://avatars.githubusercontent.com/u/60619308?v=4" />
        <div>
          <h1>asd</h1>
          <p className='center-text'>sdf</p>
        </div>
      </div> 

    <div className="container">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
      </header>
    </div>
    </div>
  );
}

export default App;
